DROP TABLE IF EXISTS `CUSTOMER`;
CREATE TABLE `CUSTOMER` (
  `ID` int(6) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `NAME` varchar(100) COLLATE utf8mb3_bin NOT NULL,
  `PASSWORD` varchar(64) COLLATE utf8mb3_bin NOT NULL,
  `NONCE` decimal(20,0) unsigned zerofill NOT NULL,
  `POINT` int(11) unsigned zerofill NOT NULL,
  `ADD_DATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE current_timestamp(),
  `EXPIRED_DATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `UPDATE_DATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`ID`),
  KEY `NAME` (`NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_bin;

