DROP TABLE IF EXISTS `GIVE_RO_REDEEM`;
CREATE TABLE `GIVE_RO_REDEEM` (
  `ADD_DATE` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `TRAN_TYPE` int(1) unsigned zerofill NOT NULL,
  `CUSTOMER_ID` int(6) unsigned zerofill NOT NULL,
  `REWARD_ID` int(7) unsigned zerofill NOT NULL,
  `REWARD_POINT` int(7) unsigned zerofill NOT NULL,
  `VOLUME` int(7) unsigned zerofill NOT NULL,
  `TOTAL_POINT` int(10) unsigned zerofill NOT NULL,
  KEY `CUSTOMER_ID` (`CUSTOMER_ID`),
  KEY `REWARD_ID` (`REWARD_ID`),
  CONSTRAINT `GIVE_RO_REDEEM_ibfk_1` FOREIGN KEY (`CUSTOMER_ID`) REFERENCES `CUSTOMER` (`ID`),
  CONSTRAINT `GIVE_RO_REDEEM_ibfk_2` FOREIGN KEY (`REWARD_ID`) REFERENCES `REWARD` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_bin;


DROP TABLE IF EXISTS `REWARD`;
CREATE TABLE `REWARD` (
  `ID` int(7) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `NAME` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin NOT NULL,
  `AMOUNT` int(7) unsigned zerofill NOT NULL,
  `BALANCE` int(7) unsigned zerofill NOT NULL,
  `POINT` int(7) unsigned zerofill NOT NULL,
  `IMAGE` blob NOT NULL,
  `ACTIVE` tinyint(1) NOT NULL,
  `ADD_DATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE current_timestamp(),
  `UPDATE_DATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`ID`),
  CONSTRAINT `REWARD_ibfk_1` FOREIGN KEY (`ID`) REFERENCES `CUSTOMER` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_thai_520_w2;

